sidebarCSS:
div.NavigationBar {
	counter-reset: panel;
}

div.nav-item[data-class="panel"][data-type="tabs"]::before {
	counter-increment: panel;
	content:counter(panel);
	color:rgb(133, 133, 122);
	font-size:x-small;
	padding-left: 3px;
}

div.PinnedTabsBar {
	counter-reset: pinnedtabs;
}

div.Tab[data-pin="true"]::before {
	counter-increment: pinnedtabs;
	content:counter(pinnedtabs);
	color:rgb(133, 133, 122);
	font-size:x-small;
	padding-left: 3px;
	position: absolute;
	z-index: 1000;
}
